is).scrollTop() > 120) {\n						$(\"#subOverlay\").fadeOut();\n						$(\"#top\").fadeIn();\n					} else {\n						$(\"#subOverlay\").fadeIn();\n						$(\"#top\").fadeOut();\n					}\n\n				});  \n			});\n		</script>  \n<!-- <script src=\"https://webcheckin.jaleshcruises.com/assets/cruise/js/cruise.js\"></script> -->\n\n 	<script>\n		function checkDependancy(guestId,DependantOn){\n			var names = \'\';\n			$(\'.guest_check\').each(function(){\n				if($(this).data(\'dependancy\') == guestId+\'_Y\'){\n					$(\'#dependant\').val(DependantOn);\n					if(!$(this).is(\':checked\')){\n	            		names += $(this).data(\'name\')+\', \';\n					}\n		        }\n		    });\n		    var nameString = names.substring(0,names.lastIndexOf(\",\"));\n		    $(\'#dependancy\').val(nameString);\n		}\n		$(\'.guest_check\').each(function(){\n			$(this).click(function() {\n				var guestID = $(this).val();\n				// var checkDepen = $(this).data(\'dependancy\');\n				var DependantOn = $(this).data(\'dependanton\');\n				// var depArray = checkDepen.split(\"_\");\n				checkDependancy(guestID,DependantOn);\n			});\n		});\n\n		$(\'input[name=\"crn\"]\').bind(\'change keyup blur\',function(){ \n		    var node = $(this);\n		    node.val(node.val().replace(/[^a-zA-Z0-9]/g,\'\') ); }\n		);\n\n		$(\'.cardcuisine .custom-control-inline input[type=\"radio\"]\').on(\'click\',function(){\n			var tabs = $(\'.ticketcontainer ul.nav.nav-tabs\');\n			var activeTab = $(tabs).find(\'li a.active\');\n			$(activeTab).parent().next(\'li\').find(\'a\').trigger(\'click\');\n			$(activeTab).removeClass(\'active\');\n		});\n		\n		$(\"#pnr\").validate({\n			rules: {\n				\"last_name\" : {\n					letterandspaceonly: true,\n					required: true\n				},\n				\"crn\" : { required: true },\n				\"date_of_departure\" : { required: true },\n				\"ship_name\" : { required: true }\n			}\n		});\n		\n		$(\'#personal_info\').validate({\n			rules: {\n				\'document_number\' : {\n					\'required\': true\n				}\n			}\n		});\n		\n		$(\'#immi